import React from 'react';
import loadingGif from '../assets/loading.gif'; // Correct path to your loading GIF

const UserProfile = () => {
  return (
    <div>
      <h1>User Profile</h1>
      <p>Looking for Trinket device...</p>
      <img src={loadingGif} alt="Loading" />
      {/* Additional user profile elements */}
    </div>
  );
};

export default UserProfile;
